import React, { Component } from "react";
import { PrivateRoute } from "jwt-auth-react";
import { AuthProvider } from "jwt-auth-react";
import Home from "./Home";
import Main from "./Main";
import Login from "./Login";
import DashBoard from "./Pages/Dashboard";
import ResetPage from "./Pages/ResetPage";
import Report from "./Pages/Report";
import Data from "./Data/informationData";
import { Switch, Route } from "react-router-dom";

class Routers extends Component {
  render() {
    const Hom = () => {
      return <Home />;
    };
    const Questionair = () => {
      return <Main />;
    };
    const Log = () => {
      return <Login />;
    };
    const Das = () => {
      return <DashBoard />;
    };
    const Reset = () => {
      return <ResetPage />;
    };
    const ReportChart = () => {
      return <Report />;
    };
    function authen(Data) {
      if (Data[0].user === "admin" && Data[0].password === "1234") {
        return true;
      } else {
        return false;
      }
    }
    return (
      <Switch>
        <Route exact path="/" render={Hom} />
        <Route exact path="/home" render={Hom} />
        <Route exact path="/main" render={Questionair} />

        <AuthProvider>
          <Route exact path="/admin" render={Log} />
          <Route exact path="/admin/login" render={Log} />
          <PrivateRoute
            exact
            path="/admin/dash"
            render={Das}
            loginPath={"/admin/login"}
          />
          <PrivateRoute
            exact
            path="/admin/reset"
            render={Reset}
            loginPath={"/admin/login"}
          />
          <PrivateRoute
            exact
            path="/admin/report"
            render={ReportChart}
            loginPath={"/admin/login"}
          />
        </AuthProvider>
      </Switch>
    );
  }
}

export default Routers;
